import { useState } from 'react';
import { ReactComponent as Logo } from '../images/symbol.svg';
import { ButtonGroup, Divider, Toolbar, IconButton } from '@material-ui/core';
import SecurityIcon from '@material-ui/icons/Security';
import PersonIcon from '@material-ui/icons/Person';
import HeaderStyle from './headerStyle';

function Header(props) {
  const [index, setIndex] = useState(0);
  const [search, setSearch] = useState('');
  const styles = HeaderStyle();

  function searchUser(event) {
  }

  return (
    <Toolbar className={styles.bar}>
      <Logo alt='brand' />
      <Divider className={styles.divider} orientation="vertical" flexItem />
      <ButtonGroup className={styles.type} variant="contained">
        <IconButton
          aria-label='type'
          className={index === 0? styles.gradientType : styles.whiteType}
          onClick={() => setIndex(0) }
        >
          <SecurityIcon />
        </IconButton>
        <IconButton
          aria-label='type'
          className={index === 1? styles.gradientType : styles.whiteType}
          onClick={() => setIndex(1) }
        >
          <PersonIcon />
        </IconButton>
      </ButtonGroup>
      <form className='form' onSubmit={searchUser} id='header-form'>
        <input
          className='search'
          id='header-search'
          name='search'
          onChange={(e) => setSearch(e.target.value)}
          placeholder={'Pesquisar...'}
          type='text'
          value={search} />
        <input className='material-icons' type='submit' value='search' />
      </form>
      <div className='buttons'>
        <button className='filter' onClick={() => { }}>
          <i className='material-icons'>tune</i>
        </button>
        <button className='add' onClick={() => { }}>
          <i className='material-icons'>person</i>
          INCLUIR USU√ÅRIO
        </button>
      </div>
      <Divider className={styles.divider} orientation="vertical" flexItem />
      <div className='pages'>
        <button className='button' onClick={() => { }}>
          <i className='material-icons'>home</i>
        </button>
        <button className='button' onClick={() => { }}>
          <i className='material-icons'>settings</i>
        </button>
        <button className='button' onClick={() => { }}>
          <i className='material-icons'>power_settings_new</i>
        </button>
      </div>
    </Toolbar>
  );
}

export default Header;
